function setYear(century) {
    if (century > 0) {
        document.getElementById("min-year").value = (century - 1) * 100 + 1;
        document.getElementById("max-year").value = century * 100;

    } else {
        document.getElementById("min-year").value = century * 100;
        document.getElementById("max-year").value = (parseInt(century) + 1) * 100 - 1;
    }
}


// FROM https://www.w3schools.com/howto/howto_js_cascading_dropdown.asp

function updateOptions(name, to_id, data_obj, mode) {
    let topicSel = document.getElementById(to_id);
    // console.log(name);
    topicSel.length = 1;
    // console.log(data_obj[name]);
    if (mode === 1){
        var z = data_obj[name];
        for (var i = 0; i < z.length; i++) {
            // console.log(z[i]);
            topicSel.options[topicSel.options.length] = new Option(z[i], z[i]);
        }
    } else {
        for (var y in data_obj[name]) {
          topicSel.options[topicSel.options.length] = new Option(y, y);
        }
    }

}

function geoUpdate(name) {
    updateOptions(name, "region", geo, mode=1)
}


function nowDistrictUpdate(name) {
    updateOptions(name, "district-now", geo_museum, mode=0)
}

function nowMuseumUpdate(name) {
    let regionName = document.getElementById("region-now").value;
    updateOptions(name, "museum-now", geo_museum[regionName], mode=1)
}

function forceSearch(from, to, page){
    let form = document.getElementById(from);

    form.addEventListener('submit', (evt) => {
      evt.preventDefault();
      let formData = new FormData(form);
      let params = new URLSearchParams(formData);
      console.log(params.toString());
      document.getElementById(to).data = "/" + page + "?" + params.toString();
    });
}